import React from 'react';
import emailjs from 'emailjs-com';

import './contact.css';

export default function ContactUs() {

  function sendEmail(e) {
    e.preventDefault();

    emailjs.sendForm('service_unwkzbo', 'template_8x0hctx', e.target, 'user_KfgjeRuATC8yMbI6chlki')
      .then((result) => {
          console.log(result.text);
      }, (error) => {
          console.log(error.text);
      });
      e.target.reset()
  }

  return (

<div class="fh5co-narrow-content animate-box fadeInLeft animated" data-animate-effect="fadeInLeft">

				<div class="row">
					<div class="container">
						<h2 className="entrecontato">  Entre em contato </h2>
					</div>

				</div>
        <br /><br />
				<form className="contact-form container" onSubmit={sendEmail}>

<div class="form">
  <input type="text" name="text" autocomplete="off" required />
  <label for="text" class="label-name">
    <span class="content-name">
      Your Text
    </span>
  </label>
</div>

					<div class="row">
						<div class="col-md-10 col-md-offset-1">
							<div class="row">
								<div class="col-md-6">
									<div class="form-group">
										<input type="text" class="form-control" placeholder="Nome..."/>
									</div>
									<div class="form-group">
										<input type="text" name="user_email" class="form-control" placeholder="Email..."/>
									</div>
									<div class="form-group">
										<input type="text" name="contact_number"  class="form-control" placeholder="Telefone.."/>
									</div>
								</div>
								<div class="col-md-6">
									<div class="form-group">
										<textarea name="message" cols="50" rows="100" class="form-control" placeholder="Conte-me o que precisa"></textarea>
									</div>
									<div class="form-group">
										<input type="submit" value="Enviar" class="btn btn-primary btn-md" />
									</div>
								</div>

							</div>
						</div>

					</div>
				</form>
			</div>

  );
}
